import React, { useState, useEffect } from 'react';
import './App.css';
import Login from './components/Login';
import Signup from './components/Signup';
import Dashboard from './components/Dashboard';
import Explore from './components/Explore';
import Messages from './components/Messages';

function App() {
  const [view, setView] = useState('welcome');
  const [selectedReceiver, setSelectedReceiver] = useState(null);

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      setView('dashboard');
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('token');
    setView('welcome');
  };

  return (
    <div className="App">
      <h1>SkillSwap</h1>
      {view === 'welcome' && (
        <div className="page fade-in" style={{ justifyContent: 'center', minHeight: '80vh' }}>
          <div style={{ textAlign: 'center', marginBottom: '50px' }}>
            <h1 style={{ fontSize: '4rem', marginBottom: '10px', background: 'linear-gradient(135deg, #667eea, #764ba2, #f093fb)', WebkitBackgroundClip: 'text', WebkitTextFillColor: 'transparent' }}>SkillSwap</h1>
            <p style={{ fontSize: '1.3rem', marginBottom: '40px', maxWidth: '600px', margin: '0 auto 40px' }}>Connect with peers, share skills, and learn together in a vibrant community.</p>
            <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', gap: '30px', marginBottom: '50px' }}>
              <div className="feature-card">
                <div style={{ fontSize: '3rem', marginBottom: '15px' }}>ü§ù</div>
                <h3>Connect</h3>
                <p>Find like-minded individuals</p>
              </div>
              <div className="feature-card">
                <div style={{ fontSize: '3rem', marginBottom: '15px' }}>üìö</div>
                <h3>Learn</h3>
                <p>Exchange knowledge and skills</p>
              </div>
              <div className="feature-card">
                <div style={{ fontSize: '3rem', marginBottom: '15px' }}>üöÄ</div>
                <h3>Grow</h3>
                <p>Advance your personal development</p>
              </div>
            </div>
            <div className="auth-buttons" style={{ flexDirection: 'row', gap: '20px', justifyContent: 'center' }}>
              <button onClick={() => setView('login')}>Login</button>
              <button onClick={() => setView('register')}>Register</button>
            </div>
          </div>
        </div>
      )}
      {view === 'login' && (
        <div>
          <button onClick={() => setView('welcome')} style={{ marginBottom: '20px' }}>Back</button>
          <Login onSuccess={() => setView('dashboard')} />
        </div>
      )}
      {view === 'register' && (
        <div>
          <button onClick={() => setView('welcome')} style={{ marginBottom: '20px' }}>Back</button>
          <Signup />
        </div>
      )}
      {view === 'dashboard' && (
        <div>
          <button onClick={handleLogout} style={{ position: 'absolute', top: '20px', right: '20px' }}>Logout</button>
          <Dashboard setView={setView} />
        </div>
      )}
      {view === 'explore' && (
        <div>
          <button onClick={() => setView('dashboard')} style={{ position: 'absolute', top: '20px', right: '20px' }}>Back to Dashboard</button>
          <Explore setView={setView} setSelectedReceiver={setSelectedReceiver} />
        </div>
      )}
      {view === 'messages' && (
        <div>
          <Messages setView={setView} selectedReceiver={selectedReceiver} />
        </div>
      )}
    </div>
  );
}

export default App;
